public int wiley(int n, int[] list){ 
  int m = 0; 
  int rt = 0; 
  for(int i = 0; i < list.length - n; i++){ 
    rt = 0; 
    for(int j = 0; j < n; j++){ 
      rt += list[i + j]; 
    } 
    if( rt > m ){ 
      m = rt; 
    } 
  } 
