public class GList{ 

  private Node head; 

  public GList(){ 
    head = null; 
  } 

  public void insert(<*1> val){ 
    if( head == null ){ 
      head = new Node(); 
      head.data = val; 
    } 
    else { 
      Node n = new Node(); 
      n.data = val; 
      n.next = head; 
      head = n; 
    } 
  } 

  public String toString(){ 
    String result = ""; 
    Node t = head; 
    while( t != null ){ 
      result += t.data.toString(); 
      t = t.next; 
    } 
    return result; 
  } 

}
